					list-style: decimal;
					margin-bottom: 0px;
					margin-left: 22px;
					padding: 0px;
					line-height: 120%;
				}


/* Misc */
.bdrleft		{ 	
					border-left: 1px solid #A1A5A9;
				}

.bdrtop			{ 	
					border-top: 1px solid #A1A5A9;
					padding-top: 5px;
					padding-bottom: 5px;
				}				


/* Table properties */
.tableborder	{ background-color: #FFFFFF; border: 1px #A1A5A9 solid; }

.form_style		{ font-size : 12px; font-family : geneva, arial, sans-serif; width: 215px; }


